import './App.css';
import YearsCounter from './YearsCounter';


const App = () => {

  return (
    <>
    <div className='textbox'>
      <p className='title'>Owen Boseley</p>
      <p>incoming bsms @ University of Washington</p>
      <YearsCounter startDate={new Date(2003, 8, 24)}/>

      <div className='goals-container'>
        <p>Goals:</p>
        <p className='goals'>Freshman Year: ✅</p>
        <p className='goals'>Sophomore Year: ✅</p>
        <p className='goals'>Junior Year: ✅</p>
        <p className='goals'>Senior Year: ❌</p>
      </div>
    </div>
    </>
  );
};

export default App;
